import React, { useEffect, useState } from "react";
import Table from 'react-bootstrap/Table';


const Apicall = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch("http://localhost:8080/Usera").then((result) => {
      result.json().then((resp) => {
        // console.warn("result",resp)
        setData(resp);
      });
    });
  }, []);
  console.warn(data);
  const deleteUser=()=>{
    fetch('http://localhost:8080/Usera', {
      method: 'DELETE'
    })
    .then(res => res.json())
    .then(data => console.log(data))
    .catch(error => console.error(error));


  }

  return (
    <div className="App">
      <h1>Get call Api</h1>
      <Table className="table table-condensed">
        <tr>
          <td>Id</td>
          <td>Name</td>
          <td>Email</td>
          <td>Address</td>
        </tr>
        {data.map((item) => (
          <tr>
            <td>{item.id}</td>
            <td>{item.name}</td>
            <td>{item.email}</td>
            <td>{item.address}</td>
          <td><button onClick={deleteUser}>Delete</button></td>

          </tr>
        ))}
      </Table>
    </div>
  );
};

export default Apicall;
